import React, { Component } from 'react';
import {Button, Row, Col, Card, CardHeader, CardBody, Label, InputGroup, InputGroupAddon, InputGroupText, Input} from 'reactstrap';

class Global extends Component{

    constructor(props){
        super(props);
    }

    componentDidMount(){
        console.log("llegue");
    }

    render(){
        return(
            <Row>
                <Col xs="12" md="12">
                    <Row>
                        <Col xs="12" md="12">
                            <Card>
                                <CardHeader>
                                    <Row>
                                        <Col xs="10" sm="10" md="10">Editar o Crear una nueva tienda</Col>
                                        <Col xs="2" sm="2" md="2">
                                            <Button size="sm" style={{fontSize:"medium"}} block className="float-right btn btn-success active">
                                                Guardar
                                            </Button>
                                        </Col>
                                    </Row>
                                </CardHeader>
                                <CardBody>
                                    <Row>
                                        <Col>
                                            <Label>Margen protecci√≥n</Label>
                                            <InputGroup>
                                                <InputGroupAddon addonType="prepend">
                                                    <InputGroupText><i className="fa fa-shield"></i></InputGroupText>
                                                </InputGroupAddon>
                                                <Input type="text" id="percent" placeholder="Ingrese el margen a proteger" />
                                            </InputGroup>
                                        </Col>
                                    </Row>
                                </CardBody>
                            </Card>
                        </Col>
                    </Row>
                </Col>
            </Row>
        )
    }

}

export default Global;
